double **tract1(int S)
  {
   if (ncol!=nrow) debug(9,"errore in tract1...\n");
   if (nrow!=S) debug(9,"con topologia tract deve essere S=%i\n",nrow);
   double ddec=getarg_d("ddec",3.3,"decadimento connessioni non mielinate (mm)");
   double dmax=getarg_d("dmax",30,"massima distanza connessioni non mielinate (mm)");
   double wmax=0;
   for (int i=0;i<nrow;i++) for (int j=0;j<ncol;j++) if (wtmp[i][j]>wmax) wmax=wtmp[i][j];
   double **W=dmatrix(0,nrow-1,0,ncol-1);
   for (int i=0;i<nrow;i++) for (int j=0;j<ncol;j++) if (dtmp[i][j]<dmax) W[i][j]=wtmp[i][j]+wmax*exp(-dtmp[i][j]/ddec); else W[i][j]=wtmp[i][j];
   return W;
  }

void sizes(int S,int ztmp,int ktmp,int *Z,int *K)
  {
   if (nrow!=S) debug(9,"con topologia tract deve essere S=%i\n",nrow);
   double vmax=0;
   for (int i=0;i<nrow;i++) vmax+=stmp[i];
   int ztot=0;
   for (int i=0;i<nrow-1;i++)
     {
      Z[i]=(int)rint(S*ztmp*stmp[i]/vmax);
      K[i]=(int)rint(S*ktmp*stmp[i]/vmax);
      ztot+=Z[i];
     }
   Z[nrow-1]=S*ztmp-ztot;
   K[nrow-1]=(int)rint(S*ktmp*stmp[nrow-1]/vmax);
  }
